 в том числе и их слизистых оболочек, парезы мышц век, препятствующие зрению или ограничивающие движение глазного яблока (после оперативного лечения с положительным результатом допуск осуществляется индивидуально).#8) Хроническое, не поддающееся консервативному лечению воспаление слезного мешка, а также упорное, не поддающееся лечению слезотечение.#9) Паралитическое косоглазие и другие нарушения содружественного движения глаз.#10) Стойкая диплопия вследствие косоглазия любой этиологии.#11) Спонтанный нистагм при отклонении зрачков на 70° от среднего положения.#12) Ограничение поля зрения более чем на 20° в любом из меридианов.#13) Нарушение цветоощущения.#14) Заболевания сетчатки и зрительного нерва (пигментный ретинит, атрофия зрительного нерва, отслойка сетчатки и др.).#15) Глаукома.#16) Отсутствие одной верхней или нижней конечности, кисти или стопы, а также деформация кисти или стопы, значительно затрудняющая их движение. В порядке исключения могут допускаться лица с одной ампутированной голенью, если ампутационная культя не менее 1/3 голени и подвижность в коленном суставе ампутированной конечности полностью сохранена.#17) Отсутствие пальцев или фаланг, а также неподвижность в межфаланговых суставах:#отсутствие двух фаланг большого пальца на правой или левой руке;#отсутствие или неподвижность двух или более пальцев на правой руке или полное сведение хотя бы одного пальца;#отсутствие или неподвижность трех или более пальцев на левой руке или полное сведение хотя бы одного пальца (при сохранении хватательной функции и силы кисти вопрос о допуске к управлению решается индивидуально).#18) Укорочение нижней конечности более чем на 6 см - освидетельствуемые могут быть признаны годными, если конечность не имеет дефектов со стороны костей, мягких тканей и суставов, объем движений сохранен, длина конечности более 75 см (от пяточной кости до середины большого вертела бедра).#19) Отсутствие верхней конечности или кисти, отсутствие нижней конечности на любом уровне бедра или голени при нарушении подвижности в коленном суставе.#20) Травматические деформации и дефекты костей черепа с наличием выраженной неврологической симптоматики, препятствующей управлению транспортными средствами. При наличии незначительной неврологической симптоматики допуск осуществляется индивидуально с переосвидетельствованием через один год.#21) Полная глухота на одно ухо (острота слуха: разговорная речь на другое ухо менее 3 м, шепотная речь менее 1 м, или разговорная речь на каждое ухо менее 2 м (при полной глухоте, глухонемоте допуск осуществляется с переосвидетельствованием не реже чем 1 раз в год), за исключением отсутствия слуха, выраженных и значительно выраженных нарушений слуха (глухота и III, IV степень тугоухости))#22) Хроническое одностороннее или двустороннее гнойное воспаление среднего уха, осложненное холестеатомой, грануляциями или полипом (эпитимпанит). Наличие фистульного симптома (после оперативного лечения с хорошим результатом вопрос решается индивидуально).#23) Хронический гнойный мастоидит, осложнения вследствие мастоидэктомии (киста, свищ).#24) Заболевания любой этиологии, вызывающие нарушения функции вестибулярного анализатора, синдромы головокружения, нистагм (болезнь Меньера, лабиринтиты, вестибулярные кризы любой этиологии и др.).#25) Болезни эндокринной системы прогрессирующего течения со стойкими выраженными нарушениями функций других органов и систем (допуск к вождению решается индивидуально при условии ежегодного переосвидетельствования после обследования и лечения у эндокринолога).#26) Ишемическая болезнь сердца: стенокардия нестабильная, стенокардия напряжения, ФК III ст., нарушения сердечного ритма высокой градации либо сочетание указанных состояний (допуск к вождению решается индивидуально при условии ежегодного переосвидетельствования после обследования и лечения у кардиолога).#27) Гипертоническая болезнь III стадии, 3 степени, риск IV (допуск к вождению решается индивидуально при условии ежегодного переосвидетельствования п